import React, { Component } from 'react'
class Landing extends Component {
  constructor(props) {
    super(props);
    this.state = {
        results: []
    };
}/**/

componentDidMount(){

  const data = new FormData();
    fetch("http://localhost:5000/questions/showAll", {
      method: "POST",
      body:data
    })
    .then((response) => {
      console.log(response);
      response.json()
    })
      .then((result)=> {
        this.setState({results:result});
        console.log(result.questionTitle);
      })
    .catch(error=>null);
}
  render() {
    return (
      <div className="container">
        <div className="jumbotron mt-5">
          <div className="col-sm-8 mx-auto">
            <h1 className="text-center">askIT</h1>
          </div>
        </div>
        <div className="row">
          <div className="col-sm-8 mx-auto">
              {
                <p>{this.state.results}</p>
              }
          </div>
        </div>
      </div>
    )
  }
}

export default Landing;
